using namespace std;

const int N = (int) 10005, mod = (int) 0;
string s[N];
int cnt[N];
int main() {
 // freopen("kartomat.in", "r", stdin);
 // freopen("kartomat.out", "w", stdout);
  int n;
  cin >> n;
  for (int j = 0; j < n; ++j) {
    cin >> s[j];
  }
  string t;
  cin >> t;
  for (int j = 0; j < n; ++j) {
    int flag = 1;
    if (s[j].size() <= t.size()) continue;
    for (int i = 0; i < (int) t.size(); ++i) {
      if (s[j][i] != t[i]) {
        flag = 0;
      }
    }
    if (flag) {
      cnt[s[j][(int) t.size()]]++;
    }
  }
  string x = "***ABCDEFGHIJKLMNOPQRSTUVWXYZ***";
  for (int j = 0; j < (int) x.size(); ++j) {
    cout << (cnt[x[j]]? x[j]: '*');
    if (j % 8 == 7) cout << endl;
  }
  return 0;
}
